import { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todos, setTodos] = useState([]);
  useEffect(() => {
    axios
      .get('http://jsonplaceholder.typicode.com/posts?_start=1&_limit=10')
      .then((response) => setTodos(response.data))
      .catch((error) => console.log(error));
  }, []);

  return (
    <main className=''>
      {todos.map((todo) => (
        <div className="card">
            <h3 className='title' key={todo.id}>{todo.title}</h3>
            <p>{todo.body}</p>

        </div>
      ))}
    </main>
  );
}

export default App;
